import React from 'react';
import './List.scss';
import { ListSelection } from '../List-Selection/List-Selection';

interface ListProps {
    name: string,
    listItems: string[],
    itemSelected: (selectionName: string) => void
}

export class List extends React.Component<ListProps> {
    render() {
        return (
            <div className="List">
                <h2>{this.props.name}</h2>
                {this.props.listItems.map((listItem: string, index: number) => {
                    return (
                    <ListSelection
                        key={index}
                        name={listItem}
                        onClick={this.selectItem(listItem)}/>
                    )
                })}
            </div>
        );
    }

    private selectItem(item: string) {
        this.props.itemSelected(item);
    }
};
